script: |
  super -f tsv -I q6554.sql | sort > q6554.out

vector: true

inputs:
  - name: q6554.sql
    data: |
      SELECT - 68 AS col1 FROM tab0 AS cor0 WHERE NOT ( NOT col0 NOT IN ( - col1 * col0 + - col1, 20 * - - col0 * - col0, col1 ) );
  - name: tab0

outputs:
  - name: q6554.out
    data: |
      -68
      -68
      -68
